from math import gcd
def lcm(a, b): return a * b // gcd(a, b)
def inF(q): return q[0]%q[1] == 0
def delta(q, c): return ((10*q[0]+c)%2520, lcm(q[1], c))
def ok(n):
    q = (0, 1)
